sources.dark.css:
/*Dark Version
------------------------------------*/
body.dark {
	color: #999;
    background-color: #252525;	
}

body.dark .wrapper {
	background: #252525;
}

body.dark h1,
body.dark h2,
body.dark h3,
body.dark h4,
body.dark h5,
body.dark h6 {
	color: #ccc;
	font-weight: 200;
}

body.dark .wrapper p {
	color: #999;
}

body.dark p, 
body.dark li, 
body.dark li a {
	color: #999;
}

body.dark .headline {
  border-bottom: 1px dotted #555;
}

/*Headline v2
------------------------------------*/
body.dark .headline-v2,
body.dark .headline-v2.bg-color-light {
	background: #333 !important;
}

/*Parallax Backgrounds
------------------------------------*/
body.dark .parallax-bg {
	background-color: #333;
}

body.dark .parallax-bg:before {
  background: rgba(0,0,0,0.6);
}

/*Revolution Slider
------------------------------------*/
body.dark .tp-bannertimer {
  background: rgba(0,0,0,0.5);
}

body.dark .tp-banner-container .btn-u.btn-brd.btn-u-light {
  color: #fff;
}

/*Header
------------------------------------*/
body.dark .header,
body.dark .header-v3 {
	background: #222;
	border-bottom-color: #333;
}

body.dark .header.header-v1 {
	background: none;
}

/*Topbar*/
body.dark .topbar ul.loginbar li i.fa {
	color: #999;	
}

body.dark .topbar ul.loginbar > li > a {
	color: #999;
}

body.dark .topbar ul.loginbar > li > a:hover {
	color: #fff;
}

body.dark .topbar ul.languages {
	background: #333;
}

body.dark .topbar ul.languages li a {
	color: #999;
}

body.dark .topbar ul.languages li.active a,
body.dark .topbar ul.languages li a:hover {
	color: #ccc;
	background: #555;
}

body.dark .topbar ul.languages li.active a i {
	color: #ccc;
}

body.dark .topbar ul.languages:after {
	border-bottom-color: #303030;
}

body.dark .topbar ul.loginbar li.topbar-devider {
	border-right-color: #999;
}

/*Topbar v1*/
body.dark .topbar-v1 {
	background: #222;
	border-color: #555;
}

body.dark .topbar-v1 .top-v1-data li:first-child {
	border-left-color: #555;
}

body.dark .topbar-v1 .top-v1-data li {
	border-right-color: #555;
}

body.dark .topbar-v1 .top-v1-contacts li {
	color: #999;
}

body.dark .topbar-v1 .top-v1-data li i {
	color: #999;
}

/*fixed in v1.9*/
/*Navigation*/
/*body.dark .header .navbar-nav > li > a,
body.dark .header-v1 .navbar-default .navbar-nav > li > a,
body.dark .header-v3 .navbar-default .navbar-nav > li > a {
	color: #999;
}*/

body.dark .header .navbar-nav .open > a,
body.dark .header .navbar-nav .open > a:hover,
body.dark .header .navbar-nav .open > a:focus {
	border-bottom-color: #333;
}

body.dark .nav .open > a,
body.dark .nav .open > a:hover,
body.dark .nav .open > a:focus,
body.dark .header .nav > li > a:hover,
body.dark .header .nav > li > a:focus {
	background: inherit;
}

@media (max-width: 991px) {
	body.dark .header .nav > li.active > a:hover {
		background: #72c02c;	
	}
}

/*Search*/
body.dark .header .nav > li > .search {
	color: #999;
	background: #292929;
	border-bottom-color: #555;
}

body.dark .header .nav > li > .search:hover {
	background: #303030;
}

body.dark .header .search-open,
body.dark .header-v1 .navbar .search-open,
body.dark .header-v3 .navbar .search-open,
body.dark .header-v4 .navbar .search-open {
	background: #222;
	box-shadow: none;
	border-top-color: #333;
}

/*Dropdown Menu*/
body.dark .header .dropdown-menu,
body.dark .header-v1 .dropdown-menu,
body.dark .header-v2 .dropdown-menu,
body.dark .header-v3 .dropdown-menu,
body.dark .header-v4 .dropdown-menu,
body.dark .header-v5 .dropdown-menu {
	background: #222;
	border-bottom-color: #202020;
}

body.dark .header .dropdown-menu li a,
body.dark .header-v1 .dropdown-menu li a,
body.dark .header-v2 .dropdown-menu li a,
body.dark .header-v3 .dropdown-menu li a,
body.dark .header-v4 .dropdown-menu li a,
body.dark .header-v5.dropdown-menu li a {
	color: #999;
	border-bottom-color: #303030;
}

body.dark .header .dropdown-menu .active > a, 
body.dark .header .dropdown-menu li > a:hover,
body.dark .header-v1 .dropdown-menu .active > a, 
body.dark .header-v1 .dropdown-menu li > a:hover,
body.dark .header-v2 .dropdown-menu .active > a, 
body.dark .header-v2 .dropdown-menu li > a:hover,
body.dark .header-v3 .dropdown-menu .active > a, 
body.dark .header-v3 .dropdown-menu li > a:hover,
body.dark .header-v4 .dropdown-menu .active > a, 
body.dark .header-v4 .dropdown-menu li > a:hover,
body.dark .header-v5 .dropdown-menu .active > a, 
body.dark .header-v5 .dropdown-menu li > a:hover {
	color: #999 !important;
	background: #303030 !important;
}

/*Responsive Navbar*/
@media (max-width: 991px) {
	/*Topbar v1*/
	body.dark .header-v1 .topbar-v1 .top-v1-data li,
	body.dark .header-v4 .topbar-v1 .top-v1-data li {
		border-color: #555;
	}

	body.dark .header-v1 {
		border-color: #555;
	}

	body.dark .header-v1 .navbar .nav > li > .search {
		background: #333;
	}

	/*Header Navbar*/
	body.dark .navbar-form,
	body.dark .navbar-collapse {
		border-color: #555;
	}

	/*Navbar Nav*/
	body.dark .navbar-nav > .active > a {
		color: #fff;
	}

	body.dark .navbar-nav > li a {
		color: #999;
		border-bottom-color: #555;
	}

	/*Dropdown Menu*/
	body.dark .navbar-nav .open .dropdown-menu > li > a {
		color: #999;
	}

	body.dark .navbar-nav .open .dropdown-menu > li > a, 
	body.dark .navbar-nav .open .dropdown-menu > .active > a, 
	body.dark .navbar-nav .open .dropdown-menu > .active > a:hover, 
	body.dark .navbar-nav .open .dropdown-menu > .active > a:focus {
		color: #999;
	}

	body.dark .header .navbar-nav > li a,
	body.dark .header-v1 .navbar-default .navbar-nav > li a,
	body.dark .header-v3 .navbar-default .navbar-nav > li a,
	body.dark .header-v4 .navbar-default .navbar-nav > li a {
		border-bottom-color: #333;		
	}

	/*Navbar Opened*/
	body.dark .navbar-default .navbar-nav > .open > a, 
	body.dark .navbar-default .navbar-nav > .open > a:hover, 
	body.dark .navbar-default .navbar-nav > .open > a:focus {
		color: #eee;
	}

	/*Dropdown Submenu*/
	body.dark .header .dropdown .dropdown-submenu > a,
	body.dark .header-v1 .dropdown .dropdown-submenu > a,
	body.dark .header-v2 .dropdown .dropdown-submenu > a,
	body.dark .header-v3 .dropdown .dropdown-submenu > a,
	body.dark .header-v4 .dropdown .dropdown-submenu > a {
		color: #999 !important;
	}

	/*Equal Height List Style*/
    body.dark .header .mega-menu .equal-height-list h3,
    body.dark .header-v1 .mega-menu .equal-height-list h3, 
    body.dark .header-v3 .mega-menu .equal-height-list h3, 
    body.dark .header-v4 .mega-menu .equal-height-list h3 { 
		color: #999;
		border-bottom: solid 1px #333;
	}

	/*Header v3 Search Box*/
	body.dark .header-v3 .navbar .nav > li > .search {
		color: #999;
		background: #292929;
		border-bottom-color: #555;
	}

	body.dark .header-v3 .navbar .nav > li > .search:hover {
		background: #303030;
	}

	/*Header v2 Navbar*/
	body.dark .header-v2 .navbar-default .navbar-nav > li a {
		border-color: #555;
	}

	/*Header v2 Topbar*/
	body.dark .header-v2 .topbar-buttons .btn-u-light	{
		border-color: #eee;
	}

	body.dark .header-v2 .topbar-v2 {
		border-color: #555;
	}

	body.dark .header-v2 .topbar-v2 li, 
	body.dark .header-v2 .topbar-v2 li a {
		color: #999;
	}

	body.dark .header-v2 .languages-dropdown {
		background: #222;
	}

	body.dark .header-v2 .languages-dropdown:after {
		border-bottom-color: #222;
	}

	body.dark .header-v2 .languages-dropdown > li > a:hover, 
	body.dark .header-v2 .languages-dropdown > li.active > a {
		background: #333; 
	}

	/*Header v4*/
	body.dark .header-v4 .navbar-toggle, 
	body.dark .header-v4 .navbar-default .navbar-toggle:hover, 
	body.dark .header-v4 .navbar-default .navbar-toggle:focus {
		background: #1c1c1c;
	}

	body.dark .header-v4 .navbar .nav > li > .search {
		background: #292929; 
	}

	body.dark .header-v4 .navbar-nav,
	body.dark .header-v4 .navbar-default .navbar-toggle,
	body.dark .header-v4 .navbar-nav.navbar-border-bottom,
	body.dark .header-v4 .navbar-default .navbar-nav > li a	{
		border-color: #555;
	}

	body.dark .navbar-nav .open .dropdown-menu > li > a, 
	body.dark .navbar-nav .open .dropdown-menu > .active > a, 
	body.dark .navbar-nav .open .dropdown-menu > .active > a:hover, 
	body.dark .navbar-nav .open .dropdown-menu > .active > a:focus {
		background: transparent;
	}

}

@media (min-width: 992px) {
	body.dark .header-v4 .navbar-collapse {
		border-top-color: #333;
		border-bottom-color: #333;
	}
	
	body.dark .header-v4 .navbar-default .navbar-nav > li {
		margin-left: -1px;
		border-left: 1px solid #333;
		border-right: 1px solid #333;
	}

	body.dark .header-v4 .navbar-default .navbar-nav > li > a {
		color: #999;
	}	
}

/*Header Fixed (Shrink)
------------------------------------*/
/*fixed in v1.9*/
body.dark.header-fixed .header.header-fixed-shrink,
body.dark.header-fixed .header-v1.header-fixed-shrink,
body.dark.header-fixed .header-v2.header-fixed-shrink,
body.dark.header-fixed .header-v3.header-fixed-shrink,
body.dark.header-fixed .header-v5.header-fixed-shrink {
	box-shadow: 0 0 3px #000;
	background: rgba(0,0,0,0.9);
}

body.dark.header-fixed .header.header-fixed-shrink .search-open,
body.dark.header-fixed .header-v1.header-fixed-shrink .navbar .search-open,
body.dark.header-fixed .header-v2.header-fixed-shrink .navbar .search-open,
body.dark.header-fixed .header-v3.header-fixed-shrink .navbar .search-open,
body.dark.header-fixed .header-v5.header-fixed-shrink .navbar .search-open {
	box-shadow: none;
	background: rgba(0,0,0,0.9);
}

body.dark.header-fixed .header-v2.header-fixed-shrink .navbar-nav > li > a {
	color: #999;
}

/*Header Mega Menu
------------------------------------*/
@media (min-width: 992px) {
    body.dark .header .mega-menu .equal-height-in,
    body.dark .header-v1 .mega-menu .equal-height-in,
    body.dark .header-v2 .mega-menu .equal-height-in,
    body.dark .header-v3 .mega-menu .equal-height-in,
    body.dark .header-v4 .mega-menu .equal-height-in {
        border-left-color: #333;
    }
}

/*Added v1.9*/
/*Header v5 
------------------------------------*/
body.dark .header-v5 .badge-open {
    background: #222 none repeat scroll 0% 0%;
}

body.dark .header-v5 .subtotal {
    background: #222 none repeat scroll 0% 0%;
}

/*Header v6
------------------------------------*/
/*Shopping Cart*/
body.dark .header-v6 .shopping-cart .shopping-cart-open {
	background: #2a2b2b;
	border-color: #555;
	border-top-color: #72c02c;
}

body.dark .header-v6 .shopping-cart-open span.shc-title {
	color: #fff;
	border-bottom-color: #555;
}

body.dark .header-v6 .shopping-cart-open span.shc-total {
	color: #fff;
}

/*Media Queries*/
@media (max-width: 991px) {
	body.dark .header-v6 {
		background: #2a2b2b;
	}

	/*Navbar Brand*/
	body.dark.header-fixed .header-v6 .navbar-brand img.default-logo {
		display: inherit;
	}

	body.dark.header-fixed .header-v6 .navbar-brand img.shrink-logo {
		display: none;
	}

	/*Toggle*/
	body.dark .header-v6 .navbar-toggle .icon-bar {
		background: #fff;
	}

	/*Menu Inner Right*/
	body.dark .header-v6 li.menu-icons i.menu-icons-style {
		color: #fff;
	}

	/*Search*/
	body.dark .header-v6 .search-open {
		background: #2a2b2b;
		border-bottom: 1px solid #555;
	}

	body.dark.header-fixed .header-v6.header-fixed-shrink .search-open {
		border-bottom-color: #555;
	}

	body.dark .header-v6 .search-open .form-control {
		color: #fff;
		background: #2a2b2b;
	}

	body.dark .header-v6 .search-open .form-control::-moz-placeholder {
		color: #fff;
	}
	body.dark .header-v6 .search-open .form-control:-ms-input-placeholder {
		color: #fff;
	}
	body.dark .header-v6 .search-open .form-control::-webkit-input-placeholder {
		color: #fff;
	}

	body.dark .header-v6 li.menu-icons i.fa-times,
	body.dark.header-fixed .header-v6.header-fixed-shrink li.menu-icons i.fa-times {
		color: #fff;
	}

	/*Navbar Collapse*/
	body.dark .header-v6 .navbar-collapse {
		border-color: #555;
		border-bottom-color: #555;
	}

	/*Navbar Nav*/
	body.dark .header-v6 .navbar-nav > li a {
		color: #ccc;
		border-top-color: #555;
	}

	body.dark .header-v6 .navbar-nav > li a:hover {
		color: #72c02c;
	}

	body.dark .header-v6 .navbar-nav > .open > a,
	body.dark .header-v6 .navbar-nav > .open > a:hover,
	body.dark .header-v6 .navbar-nav > .open > a:focus {
		color: #fff;
	}

	/*Dropdown*/
	body.dark .header-v6 .navbar-nav .open .dropdown-menu > li > a {
		color: #ccc;
	}

	body.dark .header-v6 .navbar-nav .open .dropdown-menu > li > a:hover {
		color: #72c02c;
	}

	/*Submenu*/
	body.dark .header-v6 .dropdown .dropdown-submenu > a {
		color: #fff !important;
	}

	/*Mega Menu*/
	body.dark .header-v6 .mega-menu .equal-height-list h3 {
		color: #fff;
	}
}

@media (min-width: 992px) {
	/*Header*/
	body.dark.header-fixed .header-v6.header-fixed-shrink,
	body.dark .header-v6.header-classic-white .navbar {
		box-shadow: none;
		background: #2a2b2b;
	}

	body.dark.header-fixed .header-v6.header-fixed-shrink .navbar {
		background-color: inherit;
	}

	/*Navbar Brand*/
	body.dark.header-fixed .header-v6.header-fixed-shrink .navbar-brand img.default-logo {
		display: none;
	}
	/*fixed in v1.9*/
	body.dark.header-fixed .header-v6.header-fixed-shrink .navbar-brand img.shrink-logo {
		display: inherit;
	}

	/*Navbar*/
	body.dark.header-fixed .header-v6.header-fixed-shrink .navbar-nav > li > a,
	body.dark.header-fixed .header-v6.header-classic-white .navbar-nav > li > a {
		color: #fff;
	}

	body.dark.header-fixed .header-v6.header-fixed-shrink .navbar-nav .active > a,
	body.dark.header-fixed .header-v6.header-fixed-shrink .navbar-nav li > a:hover {
		color: #72c02c;
	}

	body.dark.header-fixed .header-v6.header-fixed-shrink li.menu-icons i.menu-icons-style,
	body.dark.header-fixed .header-v6.header-classic-white li.menu-icons i.menu-icons-style {
		color: #fff;
	}

	/*Search*/
	body.dark .header-v6 .search-open {
		background: #2a2b2b;
		border-bottom: 1px solid #555;
	}

	body.dark.header-fixed .header-v6.header-fixed-shrink .search-open {
		border-bottom-color: #555;
	}

	body.dark .header-v6 .search-open .form-control {
		color: #fff;
		background: #2a2b2b;
	}

	body.dark .header-v6 .search-open .form-control::-moz-placeholder {
		color: #fff;
	}
	body.dark .header-v6 .search-open .form-control:-ms-input-placeholder {
		color: #fff;
	}
	body.dark .header-v6 .search-open .form-control::-webkit-input-placeholder {
		color: #fff;
	}

	body.dark .header-v6 li.menu-icons i.fa-times,
	body.dark .header-fixed .header-v6.header-fixed-shrink li.menu-icons i.fa-times {
		color: #fff;
	}

	/*Dropdown*/
	body.dark .header-v6 .dropdown-menu {
		background: #2a2b2b;
	}

	body.dark .header-v6 .dropdown-menu li a {
		color: #ccc;
	}

	body.dark .header-v6 .dropdown-menu .active > a,
	body.dark .header-v6 .dropdown-menu li > a:hover {
		color: #72c02c;
	}
	
	body.dark .header-v6 .dropdown-menu > li > a:hover,
	body.dark .header-v6 .dropdown-menu > li > a:focus {
		background: inherit;
	}

	/*Equal Height List Style*/
	body.dark .header-v6 .mega-menu .equal-height-in {
        border-left-color: #777;
    }

    body.dark .header-v6 .mega-menu .equal-height-list h3 { 
		color: #fff; 
	}

	body.dark .header-v6 .mega-menu .equal-height-list li a {
		color: #ccc;
	}

	body.dark .header-v6 .mega-menu .equal-height-list .active > a,
	body.dark .header-v6 .mega-menu .equal-height-list li a:hover {
		color: #72c02c;
	}
}

/*Header v7
------------------------------------*/
body.dark .header-v7 .navbar {
	background: #333;
}

body.dark .header-v7 .navbar-default .navbar-nav > li > a ,
body.dark .header-v7 .navbar-default .navbar-nav > li > a:after{
	color: #ccc;
}

/*Toggle*/
body.dark .header-v7 .navbar-toggle .icon-bar {
	background: #ccc;
}

/*Media Queries*/
@media (min-width: 768px) {
	body.dark .header-v7 .navbar-default {
		border-left-color: rgba(218,218,218,0.1);
        border-right-color: rgba(218,218,218,0.1);
	}

	body.dark .header-v7 .dropdown-menu {
		background: #333;
	}

	body.dark .header-v7 .navbar-default .navbar-nav > li > a:focus {
		color: #ccc;
	}
}

@media (max-width: 991px) {
	body.dark .navbar-collapse {
		background: #333;
	}

	body.dark .header-v7 .navbar-default .navbar-nav > li > a {
		border-bottom-color: #777;
	}
}

/*Boxed Layout
------------------------------------*/
body.dark.boxed-layout {
  box-shadow: 0 0 5px #191919;
  background: url(../../img/patterns/4.png) repeat;
}

/*Breadcrumbs
------------------------------------*/
body.dark .breadcrumbs {
	background: #1c1c1c;
	border-bottom-color: #252525;
}

body.dark .breadcrumb a {
	color: #999;
}

body.dark .breadcrumbs-v1 h1,
body.dark .breadcrumbs-v3 h1 {
	font-weight: 400;
}

body.dark .breadcrumbs-v2 h1,
body.dark .breadcrumbs-v3 h1,
body.dark .breadcrumbs-v3 p {
	color: #eee;
}

body.dark .breadcrumbs-v1 p,
body.dark .breadcrumbs-v1 h1,
body.dark .breadcrumbs-v1 span {
	color: #ccc;
}

body.dark .breadcrumbs-v1:after,
body.dark .breadcrumbs-v3:after {
  background: rgba(0,0,0,0.6);
}
/*Main Slider Parallax
------------------------------------*/
body.dark .slider-inner .da-slider {
	border-bottom-color: #444;
}

/*Purchase
------------------------------------*/
body.dark .purchase {
	background: #252525;
	border-bottom-color: #2b2b2b;
}

body.dark .purchase span {
	color: #ccc;
	font-weight: 200;
}

/*Clients
------------------------------------*/
body.dark .clients li {
	background: #292929;
}

body.dark .clients li:hover {
	background: #303030;
}

/*List Group
------------------------------------*/
body.dark .list-group-item,
body.dark .list-group-item:hover {
	background: #222;
	border-color: #303030;
}

body.dark .list-toggle a:focus {
	color: #ccc;
}

body.dark .list-toggle:after {
	color: #999;
}

body.dark .sidebar-nav-v1 > li.active > a {
	color: #ccc;
	background: #292929;
}

body.dark .sidebar-nav-v1 > li.active,
body.dark .sidebar-nav-v1 > li.active:hover {
  	background: #202020;
}

body.dark .sidebar-nav-v1 li ul, 
body.dark .sidebar-nav-v1 li.active ul a {
	color: #999;
	background: #222;
}

body.dark .sidebar-nav-v1 li ul a {
	border-top-color: #303030;
}

body.dark .sidebar-nav-v1 li ul a:hover,
body.dark .sidebar-nav-v1 ul li.active a {
	color: #ccc;
}

/*Bootstrap Features
------------------------------------*/
label {
	color: #999;
}

body.dark strong {
	color: #ccc;
}

body.dark dt {
	color: #ccc;
}

body.dark dd {
	color: #999;
}

body.dark hr {
	border-color: #333;
}

body.dark code {
	background: #333;
}

/*Form Control
------------------------------------*/
body.dark .form-control {
	color: #999;
	border-color: #303030;
	background: #202020;
}

body.dark .form-control:focus {
	box-shadow: none;
	border-color: #555;
}

body.dark .input-group-addon {
	border-color: #303030;
	background: #202020;
}

/*Close
------------------------------------*/
body.dark .close {
	color: #999;
	text-shadow: none;
}

body.dark .close:hover {
	color: #bbb;
}

/*Alert Warning 
------------------------------------*/
body.dark .alert-info,
